import PropTypes from 'prop-types';


function PersonImage({personImage}) {
  return (
    <>
    <img src={personImage} alt={personName} />
    </>
  );
}
 
PeopleList.propTypes = {
  people: PropTypes.array
}
 
export default PersonImage;
